Mstatili $ABCD$ una kituo $O$ na $AB/AD=k$. Nukta inachaguliwa kwa nasibu kutoka ndani ya mstatili $ABCD$. Je, ni uwezekano gani kwamba iko karibu na $O$ kuliko ilivyo kwa mojawapo ya pembe nne?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

